import React from "react";
import products from './products.json'

const Product = props => {
  return (
    <div data-type="computer" data-price="400" class="col-md-4 sortClass">
      {/* <!-- Card --> */}
      <div class="card">
        {/* <!-- Card image --> */}
        <div class="view overlay">
          <img class="card-img-top" src="./lib/img/product1.jpg" alt="Laptop" />
          <a href="#!">
            <div class="mask rgba-white-slight" />
          </a>
        </div>

        {/* <!-- Card content --> */}
        <div class="card-body">
          {/* <!-- Title --> */}
          <h4 class="card-title">HP Elite Laptop</h4>
          {/* <!-- Text --> */}
          <p class="card-text">$399.99</p>
          {/* <!-- Button --> */}
          <p class="card-text">
            Powered By Intel's Core i3 Processor, 8GB Of Ram & 1 TB of Hard
            Drive space, you can store all of the apps, games, photos, music and
            movies that you need.
          </p>
          <a href="##" class="btn btn-primary">
            Order Now!
          </a>
        </div>
      </div>
      {/* <!-- Card --> */}
    </div>
  );
};

export default Product
